import React from 'react';
import ReactDOM from 'react-dom';


let exampleStyle = {
  background: "skyblue",
  borderBottom: "1px solid red"
}

let element = (
  <div>
    <h1 style = {exampleStyle}>hellow</h1>
  </div>
)

ReactDOM.render(
  element,
  document.querySelector('#root')
)
